import countryService from "@/services/country/country"


export default {
    async fetchCountry({ commit }) {
        const res = await commentService.getAll()
        commit("GET_CATEGORY", res.data)
        return res.data
    },
    async createCountry({ commit }, data) {
        const res = await commentService.create(data)
        commit("POST_CATEGORY", res.data)
        console.log(res.status)
        return res
    },
    async updateCountry({ commit }, data) {
        console.log(data)
        const res = await commentService.update(data)
        commit("PUT_CATEGORY", res.data)
        console.log(res)
        return res
    },
    /* eslint-disable */
    async deleteCountry({ commit }, data) {
        const res = await commentService.delete(data.id)
        // commit("DELETE_CATEGORY", data)
        return res
    }
};
